export default (function(a,b,c,d,e){return {data:{St25rKYdsW:{data:{id:2579,attributes:{imdbId:"tt0117894",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMDNlZGZlYjctYzM4OS00YTcyLWE1M2QtMDA5Nzk0MTlhNzcxXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.8\u002F10"},{Source:"Rotten Tomatoes",Value:"15%"},{Source:"Metacritic",Value:"33\u002F100"}],item_lang:{data:{id:3242,attributes:{title:c,plot:"A fat Lawyer finds himself growing \"Thinner\" when an old gypsy man places a hex on him. Now the lawyer must call upon his friends in organized crime to help him persuade the gypsy to lift the curse. Time is running out for the desperate lawyer as he draws closer to his own death, and grows ever thinner.",slug:"thinner"}}},books:{data:[{id:12394,attributes:{title:c,description:"'Thinner' - the old gypsy man barely whispers the word. Billy feels the touch of a withered hand on his cheek. Billy Halleck, prosperous if overweight citizen, happily married, shuddered then turned angrily away. The old woman's death had been none of his fault. The courts had cleared him. She'd just stumbled in front of his car. Now he simply wanted to forget the whole messy business. Later, when the scales told him he was losing weight, it was what the doctor ordered. His wife was pleased - as she should have been. But . . . 'Thinner' - the word, the old man's curse, has lodged in Billy's mind like a fattening worm, eating at his flesh, at his reason. And with his despair, comes violence.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=MsJluAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a,d],firstBook:true,published:"2012-07-01",publisher:"Hodder Paperbacks",subtitle:e}},{id:12395,attributes:{title:c,description:"After an old gypsy woman is killed by his car, lawyer Billy Halleck is stricken with a flesh-wasting malady and must undertake a nightmarish journey to confront the forces of death",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=TKgOAQAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[d,a],firstBook:b,published:"1985-01-01",publisher:"Berkley",subtitle:e}},{id:12396,attributes:{title:"The Running Man",description:"Welcome to America in 2025 when the best men don't run for president. They run for thier lives--in the ultimate death game.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=3g9dN4rVVEUC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d,a],firstBook:b,published:"1999-01-01",publisher:"Penguin",subtitle:e}},{id:12397,attributes:{title:"Blaze",description:"Richard Bachman was Stephen Kings other writing name for his non-supernatural work before he finally hit it big with \"Carrie.\" The manuscript of \"Blaze\" sat in a university library until King rewrote it decades later.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=s1ai88XU3XIC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:b,published:"2007-01-01",publisher:"Simon and Schuster",subtitle:"A Novel"}},{id:12398,attributes:{title:"The Bachman Books",description:"A collection of Stephen King's early works, written under the pseudonym of Richard Bachman.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=vElZAAAAYAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:b,published:"1996-01-01",publisher:"Plume Books",subtitle:"Four Early Novels"}}]}}},meta:{}}},prerenderedAt:1680940911052}}("Richard Bachman",null,"Thinner","Stephen King",""))